    /**
     * Attempts to get the embedded value list for the given type (or returns
     * null if one doesn't exist).
     * 
     * @param pType
     *            the type of which to retrieve the value.
     * @return the collection of embedded value names.
     */
    @SuppressWarnings("rawtypes")
    public static java.util.Collection getEmbeddedValues(final Class pType) {
        return (java.util.Collection) EMBEDDED_VALUES_BY_TYPE.get(pType);
    }

    /**
     * Gets the type of the navigable association end given the
     * <code>ownerType</code> and <code>name</code>
     * 
     * @param pOwnerType
     *            the owner of the association.
     * @param pName
     *            the name of the association end to find.
     * @return the type of the association end.
     */
    @SuppressWarnings("rawtypes")
    public static Class getNavigableAssociationEndType(final Class pOwnerType,
            final String pName) {
        final java.util.Collection lEnds =
                NAVIGABLE_ASSOCIATIONENDS_BY_TYPE.get(pOwnerType);
        final AssociationType lType =
                (AssociationType) org.apache.commons.collections.CollectionUtils.find(
                        lEnds, new org.apache.commons.collections.Predicate() {
                            public boolean evaluate(final Object pObject) {
                                return ((AssociationType) pObject).name.equals(pName);
                            }
                        });
        return lType != null ? lType.type : null;
    }

    /**
     * A private class storing the association name and type.
     */
    @SuppressWarnings("rawtypes")
    protected static final class AssociationType {
        protected AssociationType(final String pName, final Class pType) {
            this.name = pName;
            this.type = pType;
        }

        protected String name;

        protected Class type;
    }
